function update_dslf_sf_ui(){
	mode = value("csp.lf.geom2.opt_mode");
	mode2 = value("csp.lf.geom1.opt_mode");
	enable("ColAz",(mode!=0)||(mode2!=0));
}

on_load{"Linear Fresnel Solar Field"}=define(){
	on_change{"csp.lf.sf.sm_or_area"}();
	on_change{'is_oncethru'}();
	update_dslf_sf_ui();
		};

on_change{"csp.lf.sf.sm_or_area"}=define(){
	mode = value("csp.lf.sf.sm_or_area");
	enable("csp.lf.sf.specified_solar_multiple",mode==0);
	enable("csp.lf.sf.specified_total_aperture",mode==1);
	};

on_change{'is_oncethru'}=define(){
	mode = value('is_oncethru');
	enable('x_b_des',mode==0);
	};
